sequences = {'Rosalind_8371':'', 'Rosalind_1808':'', 'Rosalind_3084':'', 'Rosalind_2280':'', 'Rosalind_7995':''}
rosalind_id = list(sequences.keys())
GC_score = {}
index = 0
for i in sequences.keys():
    z = sequences[i]
    C = z.count('C')
    G = z.count('G')
    ans = ((C+G)/len(z))*100
    GC_score[rosalind_id[index]] = ans
    index = index + 1
    
max_value = max(GC_score, key=GC_score.get)
print(max_value,'\n',GC_score[max_value],sep="")